import React, { useState, useEffect } from 'react';
import './Profile.css';
import YourProfile from './YourProfile';
import MyProgress from './MyProgress';
import ExerciseTracker from './ExerciseTracker';
import MyMedicalHistory from './MyMedicalHistory';
import MyArticles from './MyArticles';
import MySubscription from './MySubscription';
import MyTrainer from './MyTrainer';

const Profile = () => {
    const [menuOpen, setMenuOpen] = useState(false);
    const [selectedMenu, setSelectedMenu] = useState('Your Profile');

    const toggleMenu = () => {
        setMenuOpen(!menuOpen);
    };

    const handleMenuClick = (menu) => {
        setSelectedMenu(menu);
    };

    useEffect(() => {
        setSelectedMenu('Your Profile');
    }, []);

    return (
        <div className="profile-page">
            {/* Sidebar */}
            <div className={`sidebar ${menuOpen ? 'open' : ''}`}>
                <button className="toggle-btn" onClick={toggleMenu}>
                    {menuOpen ? '←' : '→'}
                </button>
                <ul>
                    <li className="menu-heading">Menu</li>
                    <li className={selectedMenu === 'Your Profile' ? 'active' : ''} onClick={() => handleMenuClick('Your Profile')}>My Profile</li>
                    <li className={selectedMenu === 'My Programs' ? 'active' : ''} onClick={() => handleMenuClick('My Programs')}>My Programs</li>
                    <li className={selectedMenu === 'My Diet Plans' ? 'active' : ''} onClick={() => handleMenuClick('My Diet Plans')}>My Diet Plans</li>
                    <li className={selectedMenu === 'My Exercise Tracker' ? 'active' : ''} onClick={() => handleMenuClick('My Exercise Tracker')}>My Exercise Tracker</li>
                    <li className={selectedMenu === 'My Articles' ? 'active' : ''} onClick={() => handleMenuClick('My Articles')}>My Articles</li>
                    <li className={selectedMenu === 'My Medical History' ? 'active' : ''} onClick={() => handleMenuClick('My Medical History')}>My Medical History</li>
                    <li className={selectedMenu === 'My Progress' ? 'active' : ''} onClick={() => handleMenuClick('My Progress')}>My Progress Story</li>
                    <li className={selectedMenu === 'My Trainer' ? 'active' : ''} onClick={() => handleMenuClick('My Trainer')}>My Trainer ⭐️</li>
                    <li className={selectedMenu === 'My Subscription' ? 'active' : ''} onClick={() => handleMenuClick('My Subscription')}>My Subscription ⭐️</li>
                </ul>
            </div>

            {/* Main Profile Content */}
            <div className="profile-content">
                <div className="profile-header">
                    <div className="profile-pic">
                        <img src="/p.jpg.jpg" alt="Profile Pic" />
                    </div>
                    <h2><center>Shreya Sharma</center></h2>
                </div>

                <div className="content">
                    {selectedMenu === 'Your Profile' && <YourProfile />}
                    {selectedMenu === 'My Programs' && (
                        <div>
                            <h3 style={{ padding: '2px', margin: '10px' }}>Currently Enrolled</h3>
                            <div className="programs">
                                <img src="/v1.png" alt="Program 1" className="program-img" />
                                <img src="/v2.jpg" alt="Program 2" className="program-img" />
                                <img src="/v3.jpg" alt="Program 3" className="program-img" />
                            </div>
                        </div>
                    )}
                    {selectedMenu === 'My Progress' && <MyProgress />}
                    {selectedMenu === 'My Exercise Tracker' && <ExerciseTracker />}
                    {selectedMenu === 'My Diet Plans' && (
                        <div>
                            <h3 style={{ padding: '2px', margin: '10px' }}>Currently Enrolled</h3>
                            <div className="programs">
                                <img src="/d2.jpg" alt="Diet Plan 1" className="program-img1" />
                                <img src="/d4.jpg" alt="Diet Plan 2" className="program-img1" />
                                <img src="/d5.jpg" alt="Diet Plan 3" className="program-img1" />
                            </div>
                        </div>
                    )}
                    {selectedMenu === 'My Medical History' && <MyMedicalHistory />}
                    {selectedMenu === 'My Articles' && <MyArticles />}
                    {selectedMenu === 'My Subscription' && <MySubscription />}
                    {selectedMenu === 'My Trainer' && <MyTrainer />}
                </div>
            </div>
        </div>
    );
};

export default Profile;
